sys_variable_value.value:
(function(outputs, steps, stepResult, assertEqual)
{
	var test = new x_snc_devtools.TestAPI(outputs, steps, stepResult, assertEqual);
	
	test.SetResult(true);

	function TestCase_GetMinimalCommonVersion(aVersions1, aVersions2, vExpected)
	{
		test.TestCase(
			'Function GetMinimalCommonVersion()',
			GetMinimalCommonVersion,
			{
				'Versions 1': aVersions1,
				'Versions 2': aVersions2
			},
			vExpected,
			null);
	}

	TestCase_GetMinimalCommonVersion(null,null,false);
	TestCase_GetMinimalCommonVersion('1.0.0',null,'1.0.0');
	TestCase_GetMinimalCommonVersion(['1.0.0','2.0.0'],null,'1.0.0');
	TestCase_GetMinimalCommonVersion(null,'1.0.0','1.0.0');
	TestCase_GetMinimalCommonVersion(null,['1.0.0','2.0.0'],'1.0.0');

	TestCase_GetMinimalCommonVersion(['1.0.0','2.0.0'],['1.2.0','2.0.0'],'1.2.0');
	TestCase_GetMinimalCommonVersion(['1.0.0','2.0.0'],['2.0.0'],'2.0.0');
	TestCase_GetMinimalCommonVersion(['1.0.0','2.0.0','3.0.0'],['2.1.0'],'2.1.0');
	TestCase_GetMinimalCommonVersion(['1.0.0','2.2.0','3.0.0'],['2.1.0'],'2.2.0');
	TestCase_GetMinimalCommonVersion(['1.0.0','2.2.0','3.0.0'],['2.1.0','4.0.0'],'2.2.0');
	TestCase_GetMinimalCommonVersion(['1.0.0','2.2.0','3.0.0'],['3.1.0','4.0.0'],'3.1.0');
	
	
	return test.GetResult();
	
})(outputs, steps, stepResult, assertEqual);
